import React, {useState, useEffect } from 'react';
import axios from "axios"
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  BarChart,
  Bar
} from 'recharts';


const ListaDiaria = () => {
    const [cidades, setCidade] = useState([]);
  
    const getListadata = async () => {
        try {
            const data = await axios.get(
                "http://localhost:5000/list_historico/"
                )
                setCidade(data.data);
  
        } catch (e) {
            console.log(e);
        }
    };

const columns = ["_id", "data", "casos", "mortes"];

useEffect(() => {
    getListadata();
}, []);


    return (
      <LineChart
        width={800}
        height={600}
        data={cidades}
        columns={columns}
        margin={{top: 5, right: 30, left: 20, bottom: 5}}
        >
        <Line
        name="Casos Confirmados"
          type='cidade'
          dataKey='casos'
          stroke='#FF8C00'
          activeDot={{r: 8}}
          />
        <CartesianGrid strokeDasharray='4 4'/>
        <Tooltip/>
        <YAxis/>
        <XAxis dataKey='data'/>
        <Line  name="Cidade"type="monotone" dataKey="_id" stroke="#FF8C00" />
        <XAxis type="number" domain={['dataMin', 'dataMax']} />
        <Legend />
      </LineChart>


        
    );
  
}

export default ListaDiaria;
